var
    space: chipmunk.Space
    particle_count = 0


proc make_ball(x: chipmunk.Float; y: chipmunk.Float): chipmunk.Shape = 
    var body: chipmunk.Body = newBody(1.0, data.INFINITY)
    body.position = chipmunk.Vect(x: x, y: y)
    result = newCircleShape(body, 0.95, chipmunk.vzero)
    result.elasticity = 0.0
    result.friction = 0.0
    
proc init_space() =
    space = chipmunk.newSpace()
    space.iterations = 1
    
    # The space will contain a very large number of similary sized objects.
    # This is the perfect candidate for using the spatial hash.
    # Generally you will never need to do this.
    space.useSpatialHash(2.0, 10000.cint)
    
    particle_count = 0
    
    var 
        body: chipmunk.Body
        shape: chipmunk.Shape
    
    # Nim-Chipmunk logo
    for pair in NIM_CHIPMUNK_BITMAP:
        shape = make_ball(
            -(IMAGE_WIDTH/2) + float(pair.x), # Offset the image
            (IMAGE_HEIGHT/2) + float(pair.y) # Offset the image
        )
        discard space.addBody(shape.body())
        discard space.addShape(shape)
        
        inc(particle_count)
    
    # Bullet that smashes "Nim"
    body = space.addBody(chipmunk.newBody(1e9, INFINITY))
    body.position = chipmunk.Vect(
        x: -930.0, 
        y: 20.0
    )
    body.velocity = chipmunk.Vect(x: 400.0, y: 0.0)

    shape = space.addShape(chipmunk.newCircleShape(body, 8.0f, chipmunk.vzero))
    shape.elasticity = 0.0
    shape.friction = 0.0
    shape.filter = data.NOT_GRABBABLE_FILTER
    
    # Bullet that smashes "Chipmunk"
    body = space.addBody(chipmunk.newBody(1e9, INFINITY))
    body.position = chipmunk.Vect(
        x: -1000.0, 
        y: -40.0
    )
    body.velocity = chipmunk.Vect(x: 400.0, y: 0.0)

    shape = space.addShape(chipmunk.newCircleShape(body, 8.0f, chipmunk.vzero))
    shape.elasticity = 0.0
    shape.friction = 0.0
    shape.filter = data.NOT_GRABBABLE_FILTER
    
    inc(particle_count)


## Procs for usage in the chipmunk_demo module
proc init*() {.procvar.} =
    init_space()

proc update*(dt: cdouble) {.procvar.} = 
    space.step(dt)

proc draw*() {.procvar.} = 
    space.eachBody(data.draw_dot, nil)
    data.draw_text(
        "Nim-Chipmunk logo smash.",
        Vect(x: DEMO_TEXT_X_OFFSET, y: DEMO_TEXT_Y_OFFSET_LINE_1)
    )
    data.draw_text(
        "There are $1 particles in the current space." % $particle_count,
        Vect(x: DEMO_TEXT_X_OFFSET, y: DEMO_TEXT_Y_OFFSET_LINE_2)
    )

proc get_space*(): chipmunk.Space {.procvar.} =
    result = space
    
proc clean_up*() {.procvar.} =
    space.clean_up_children()
    space.destroy()


